package main

import "fmt"

func main() {
	withString := robotWithString("")
	fmt.Println(withString)
}

func robotWithString(s string) string {
	cnt := make([]int, 26)
	for _, c := range s {
		cnt[c-'a']++
	}
	fmt.Println(cnt)

	stack := []rune{}
	rlt := []rune{}

	minChar := 'a'
	for _, c := range s {
		stack = append(stack, c)
		cnt[c-'a']--

		// z, z, 
		for minChar != 'z' && cnt[minChar-'a'] == 0 {
			minChar++
		}

		// , s

		// stack () s, 
		for len(stack) > 0 && stack[len(stack)-1] <= minChar {
			// 
			rlt = append(rlt, stack[len(stack)-1])
			stack = stack[:len(stack)-1]
		}
	}

	return string(rlt)
}

